import { VECTORIZEINPUT } from "../constants/actionTypes";

export const vectorizeInput = (post) => async (dispatch) => {
    try {
        const {data} = await api.vectorizeInput(post);
        console.log(data)
        dispatch({type: VECTORIZEINPUT, payload: data});
    } catch (error) {
        console.log(error);
    }
}
